    'content' => '<p><strong>рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃА рЃАрЃљрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЮ</strong> рЃљрЃарЃўрЃА рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃљрЃдрЃЏрЃљрЃАрЃарЃБрЃџрЃћрЃЉрЃћрЃџрЃў рЃ«рЃћрЃџрЃўрЃАрЃБрЃцрЃџрЃћрЃЉрЃўрЃА рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃљ, рЃарЃЮрЃЏрЃћрЃџрЃўрЃфУ┤ЪУ┤Б рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃА рЃърЃЮрЃџрЃўрЃбрЃўрЃЎрЃўрЃА рЃцрЃЮрЃарЃЏрЃўрЃарЃћрЃЉрЃљрЃАрЃљ рЃЊрЃљ рЃњрЃљрЃюрЃ«рЃЮрЃарЃфрЃўрЃћрЃџрЃћрЃЉрЃљрЃќрЃћ. рЃўрЃА рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЋрЃљрЃю рЃарЃЮрЃџрЃА рЃљрЃАрЃарЃБрЃџрЃћрЃЉрЃА рЃЦрЃЋрЃћрЃДрЃюрЃўрЃА рЃЎрЃБрЃџрЃбрЃБрЃарЃБрЃџрЃў рЃЏрЃћрЃЏрЃЎрЃЋрЃўрЃЊрЃарЃћрЃЮрЃЉрЃўрЃА рЃЊрЃљрЃфрЃЋрЃљрЃАрЃљ рЃЊрЃљ рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃљрЃерЃў, рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃЏрЃ«рЃљрЃарЃЊрЃљрЃГрЃћрЃарЃљрЃерЃў, рЃерЃћрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃўрЃЌрЃў рЃўрЃюрЃЊрЃБрЃАрЃбрЃарЃўрЃћрЃЉрЃўрЃА рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃљрЃАрЃљ рЃЊрЃљ рЃЎрЃБрЃџрЃбрЃБрЃарЃБрЃџ рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃљрЃќрЃћ рЃ«рЃћрЃџрЃЏрЃўрЃАрЃљрЃгрЃЋрЃЊрЃЮрЃЏрЃЮрЃЉрЃўрЃА рЃБрЃќрЃарЃБрЃюрЃЋрЃћрЃџрЃДрЃЮрЃцрЃљрЃерЃў.</p><h3>рЃЏрЃўрЃАрЃўрЃљрЃАрЃљ рЃЊрЃљ рЃарЃЮрЃџрЃў:</h3><p>рЃАрЃљрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЮрЃА рЃЏрЃўрЃАрЃўрЃљрЃљ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЎрЃБрЃџрЃбрЃБрЃарЃБрЃџрЃў рЃўрЃЊрЃћрЃюрЃбрЃЮрЃЉрЃўрЃА рЃЊрЃљрЃфрЃЋрЃљ рЃЊрЃљ рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃљ, рЃЎрЃБрЃџрЃбрЃБрЃарЃБрЃџрЃў рЃЏрЃарЃљрЃЋрЃљрЃџрЃцрЃћрЃарЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃ«рЃћрЃџрЃерЃћрЃгрЃДрЃЮрЃЉрЃљ рЃЊрЃљ рЃўрЃюрЃЮрЃЋрЃљрЃфрЃўрЃћрЃЉрЃўрЃА рЃгрЃљрЃ«рЃљрЃџрЃўрЃАрЃћрЃЉрЃљ. рЃўрЃњрЃў рЃ«рЃћрЃџрЃА рЃБрЃгрЃДрЃЮрЃЉрЃА рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃЌрЃљрЃЋрЃўрЃАрЃБрЃцрЃљрЃџ рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃљрЃА, рЃЎрЃБрЃџрЃбрЃБрЃарЃБрЃџрЃў рЃЊрЃљрЃгрЃћрЃАрЃћрЃЉрЃБрЃџрЃћрЃЉрЃћрЃЉрЃўрЃА рЃњрЃљрЃФрЃџрЃўрЃћрЃарЃћрЃЉрЃљрЃАрЃљ рЃЊрЃљ рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЌрЃљрЃюрЃљрЃЏрЃерЃарЃЮрЃЏрЃџрЃЮрЃЉрЃўрЃА рЃњрЃљрЃцрЃљрЃарЃЌрЃЮрЃћрЃЉрЃљрЃА.</p><h3>рЃФрЃўрЃарЃўрЃЌрЃљрЃЊрЃў рЃърЃљрЃАрЃБрЃ«рЃўрЃАрЃЏрЃњрЃћрЃЉрЃџрЃЮрЃЉрЃћрЃЉрЃў:</h3><ul><li><strong>рЃЎрЃБрЃџрЃбрЃБрЃарЃБрЃџрЃў рЃЏрЃћрЃЏрЃЎрЃЋрЃўрЃЊрЃарЃћрЃЮрЃЉрЃўрЃА рЃЊрЃљрЃфрЃЋрЃљ</strong> РђЊ рЃўрЃАрЃбрЃЮрЃарЃўрЃБрЃџрЃў рЃФрЃћрЃњрЃџрЃћрЃЉрЃўрЃА, рЃбрЃарЃљрЃЊрЃўрЃфрЃўрЃћрЃЉрЃўрЃА, рЃћрЃюрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃљрЃарЃљрЃЏрЃљрЃбрЃћрЃарЃўрЃљрЃџрЃБрЃарЃў рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃА рЃерЃћрЃюрЃљрЃарЃЕрЃБрЃюрЃћрЃЉрЃљ рЃЊрЃљ рЃърЃЮрЃърЃБрЃџрЃљрЃарЃўрЃќрЃљрЃфрЃўрЃљ</li><li><strong>рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃЏрЃ«рЃљрЃарЃЊрЃљрЃГрЃћрЃарЃљ</strong> РђЊ рЃЋрЃўрЃќрЃБрЃљрЃџрЃБрЃарЃў рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА, рЃЏрЃБрЃАрЃўрЃЎрЃўрЃА, рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА, рЃЌрЃћрЃљрЃбрЃарЃўрЃА, рЃЎрЃўрЃюрЃЮрЃАрЃљ рЃЊрЃљ рЃфрЃћрЃЎрЃЋрЃўрЃА рЃЊрЃљрЃцрЃўрЃюрЃљрЃюрЃАрЃћрЃЉрЃљ рЃЊрЃљ рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃљ</li><li><strong>рЃерЃћрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃўрЃЌрЃў рЃўрЃюрЃЊрЃБрЃАрЃбрЃарЃўрЃћрЃЉрЃўрЃА рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃљ</strong> РђЊ рЃЊрЃўрЃќрЃљрЃўрЃюрЃўрЃА, рЃЎрЃўрЃюрЃЮрЃА, рЃфрЃўрЃцрЃарЃБрЃџрЃў рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃАрЃ«рЃЋрЃљ рЃАрЃцрЃћрЃарЃЮрЃћрЃЉрЃўрЃА рЃ«рЃћрЃџрЃерЃћрЃгрЃДрЃЮрЃЉрЃљ</li><li><strong>рЃЎрЃБрЃџрЃбрЃБрЃарЃБрЃџрЃў рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃљ</strong> РђЊ рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃўрЃА рЃцрЃљрЃарЃЌрЃЮ рЃгрЃарЃўрЃАрЃЌрЃЋрЃўрЃА рЃ«рЃћрЃџрЃЏрЃўрЃАрЃљрЃгрЃЋрЃЊрЃЮрЃЏрЃў рЃерЃћрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃўрЃЌрЃў рЃърЃарЃЮрЃњрЃарЃљрЃЏрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА рЃЏрЃ«рЃљрЃарЃЊрЃљрЃГрЃћрЃарЃљ</li><li><strong>рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЎрЃБрЃџрЃбрЃБрЃарЃБрЃџрЃў рЃБрЃарЃЌрЃўрЃћрЃарЃЌрЃЮрЃЉрЃћрЃЉрЃў</strong> РђЊ рЃЌрЃљрЃюрЃљрЃЏрЃерЃарЃЮрЃЏрЃџрЃЮрЃЉрЃљ рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃљрЃфрЃўрЃћрЃЉрЃЌрЃљрЃю рЃЊрЃљ рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљ рЃњрЃџрЃЮрЃЉрЃљрЃџрЃБрЃа рЃЎрЃБрЃџрЃбрЃБрЃарЃБрЃџ рЃърЃарЃЮрЃћрЃЦрЃбрЃћрЃЉрЃАрЃљ рЃЊрЃљ рЃцрЃћрЃАрЃбрЃўрЃЋрЃљрЃџрЃћрЃЉрЃерЃў</li></ul><h3>рЃЊрЃљрЃЦрЃЋрЃћрЃЏрЃЊрЃћрЃЉрЃљрЃарЃћрЃЉрЃБрЃџрЃў рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃљрЃфрЃўрЃћрЃЉрЃў:</h3><p>рЃАрЃљрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЮ рЃќрЃћрЃЊрЃљрЃЏрЃ«рЃћрЃЊрЃЋрЃћрЃџрЃЮрЃЉрЃљрЃА рЃБрЃгрЃћрЃЋрЃА рЃерЃћрЃЏрЃЊрЃћрЃњ рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЋрЃљрЃю рЃћрЃарЃЮрЃЋрЃюрЃБрЃџ рЃЊрЃљрЃгрЃћрЃАрЃћрЃЉрЃБрЃџрЃћрЃЉрЃћрЃЉрЃА:</p><ul><li>рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃЏрЃБрЃќрЃћрЃБрЃЏрЃў</li><li>рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃърЃљрЃарЃџрЃљрЃЏрЃћрЃюрЃбрЃўрЃА рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃљ</li><li>рЃЎрЃБрЃџрЃбрЃБрЃарЃБрЃџрЃў рЃЏрЃћрЃЏрЃЎрЃЋрЃўрЃЊрЃарЃћрЃЮрЃЉрЃўрЃА рЃЊрЃљрЃфрЃЋрЃўрЃА рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃАрЃљрЃљрЃњрЃћрЃюрЃбрЃЮ</li><li>рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃЮрЃЉрЃўрЃА рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃАрЃљрЃАрЃљрЃ«рЃџрЃћ</li><li>рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃЌрЃћрЃљрЃбрЃарЃћрЃЉрЃў, рЃАрЃљрЃЎрЃЮрЃюрЃфрЃћрЃарЃбрЃЮ рЃЊрЃљрЃарЃЉрЃљрЃќрЃћрЃЉрЃў рЃЊрЃљ рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃћрЃЉрЃў</li></ul><h3>рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃЮрЃЉрЃљ:</h3><p><strong>2024 рЃгрЃџрЃўрЃА 18 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃарЃўрЃЊрЃљрЃю</strong>, рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃА рЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃўрЃљ <strong>рЃЌрЃўрЃюрЃљрЃЌрЃўрЃю рЃарЃБрЃ«рЃљрЃФрЃћ</strong> Рђћ рЃњрЃљрЃЏрЃЮрЃфрЃЊрЃўрЃџрЃў рЃърЃарЃЮрЃцрЃћрЃАрЃўрЃЮрЃюрЃљрЃџрЃў рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃА, рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃЏрЃЏрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃцрЃћрЃарЃЮрЃерЃў.</p>',
