    'content' => '<h2><strong>рЃЌрЃўрЃюрЃљрЃЌрЃўрЃю рЃарЃБрЃ«рЃљрЃФрЃћ РђЊ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃА рЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃў</strong></h2><p><strong>рЃЌрЃўрЃюрЃљрЃЌрЃўрЃю рЃарЃБрЃ«рЃљрЃФрЃћ</strong> (рЃЊ. 30 рЃўрЃЋрЃюрЃўрЃАрЃў, 1970) Рђћ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃА рЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃўрЃљ 2024 рЃгрЃџрЃўрЃА 18 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃарЃўрЃЊрЃљрЃю.<br> <strong>2016-2024 рЃгрЃџрЃћрЃЉрЃерЃў</strong> рЃўрЃА рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃЮрЃЉрЃЊрЃљ рЃљ(рЃљ)рЃўрЃъ <strong>рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃЮрЃЉрЃўрЃА рЃћрЃарЃЮрЃЋрЃюрЃБрЃџ рЃАрЃљрЃАрЃљрЃ«рЃџрЃћрЃА</strong>, рЃ«рЃЮрЃџрЃЮ <strong>2014-2016 рЃгрЃџрЃћрЃЉрЃерЃў</strong> рЃЏрЃБрЃерЃљрЃЮрЃЉрЃЊрЃљ <strong>рЃЌрЃЉрЃўрЃџрЃўрЃАрЃўрЃА рЃЏрЃБрЃюрЃўрЃфрЃўрЃърЃљрЃџрЃўрЃбрЃћрЃбрЃўрЃА рЃАрЃљрЃЎрЃарЃћрЃЉрЃБрЃџрЃЮрЃА рЃЏрЃарЃЕрЃћрЃЋрЃџрЃљрЃЊ</strong> рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃА рЃАрЃљрЃЎрЃўрЃЌрЃ«рЃћрЃЉрЃерЃў.</p><h3>рЃЉрЃўрЃЮрЃњрЃарЃљрЃцрЃўрЃљ</h3><p><strong>рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃљ:</strong></p><ul><li>1989 РђЊ 1994 РђЊ рЃЌрЃЉрЃўрЃџрЃўрЃАрЃўрЃА рЃЋрЃљрЃюрЃЮ рЃАрЃљрЃарЃљрЃ»рЃўрЃерЃЋрЃўрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃЎрЃЮрЃюрЃАрЃћрЃарЃЋрЃљрЃбрЃЮрЃарЃўрЃљ, рЃАрЃърЃћрЃфрЃўрЃљрЃџрЃЮрЃЉрЃўрЃЌ рЃЏрЃБрЃАрЃўрЃЎрЃљрЃЌрЃЏрЃфрЃЮрЃЊрЃюрЃћ</li><li>1985 РђЊ 1989 РђЊ рЃЦ. рЃЌрЃЉрЃўрЃџрЃўрЃАрЃўрЃА рЃЏрЃћрЃџрЃўрЃбрЃЮрЃю рЃЉрЃљрЃџрЃљрЃюрЃЕрЃўрЃЋрЃљрЃФрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ N3 рЃАрЃљрЃЏрЃБрЃАрЃўрЃЎрЃЮ рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў</li></ul><p><strong>рЃърЃарЃЮрЃцрЃћрЃАрЃўрЃБрЃџрЃў рЃњрЃљрЃЏрЃЮрЃфрЃЊрЃўрЃџрЃћрЃЉрЃљ:</strong><br> рЃЌрЃўрЃюрЃљрЃЌрЃўрЃю рЃарЃБрЃ«рЃљрЃФрЃћрЃЏ рЃАрЃгрЃљрЃЋрЃџрЃљ рЃЊрЃљрЃўрЃгрЃДрЃЮ рЃЏрЃћрЃџрЃўрЃбрЃЮрЃю рЃЉрЃљрЃџрЃљрЃюрЃЕрЃўрЃЋрЃљрЃФрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃљрЃЏрЃБрЃАрЃўрЃЎрЃЮ рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃерЃў (1985РђЊ1989), рЃарЃўрЃА рЃерЃћрЃЏрЃЊрЃћрЃњрЃљрЃф рЃАрЃгрЃљрЃЋрЃџрЃљ рЃњрЃљрЃљрЃњрЃарЃФрЃћрЃџрЃљ рЃЌрЃЉрЃўрЃџрЃўрЃАрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃЎрЃЮрЃюрЃАрЃћрЃарЃЋрЃљрЃбрЃЮрЃарЃўрЃљрЃерЃў (1989РђЊ1994), рЃАрЃљрЃЊрЃљрЃф рЃЏрЃБрЃерЃљрЃЮрЃЉрЃЊрЃљ рЃърЃўрЃљрЃюрЃўрЃАрЃбрЃљрЃЊ рЃЊрЃљ рЃЏрЃБрЃАрЃўрЃЎрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃљрЃЊ.</p><ul><li>1991РђЊ1993 рЃгрЃџрЃћрЃЉрЃерЃў Рђћ рЃЎрЃљрЃЏрЃћрЃарЃБрЃџрЃў рЃЮрЃарЃЎрЃћрЃАрЃбрЃарЃў РђърЃЌрЃЉрЃўрЃџрЃўрЃАрЃўрЃА рЃЎрЃЮрЃюрЃфрЃћрЃарЃбрЃўрЃюрЃЮРђю Рђћ рЃЊрЃўрЃарЃћрЃЦрЃбрЃЮрЃарЃўрЃА рЃЏрЃЮрЃљрЃЊрЃњрЃўрЃџрЃћ</li><li>1994 РђЊ рЃърЃарЃЮрЃЊрЃўрЃБрЃАрЃћрЃарЃў, рЃАрЃАрЃўрЃъ рЃАрЃљрЃЦрЃбрЃћрЃџрЃћрЃарЃљрЃЊрЃўрЃЮрЃЏрЃљрЃБрЃгрЃДрЃћрЃЉрЃџрЃЮрЃЉрЃўрЃА I рЃљрЃарЃ«рЃќрЃћ</li><li>1995 РђЊ рЃњрЃљрЃЏрЃЮрЃЏрЃерЃЋрЃћрЃЉрЃў рЃарЃћрЃЊрЃљрЃЦрЃбрЃЮрЃарЃў, II рЃљрЃарЃ«рЃў</li><li>1994РђЊ1996 РђЊ рЃбрЃћрЃџрЃћрЃцрЃћрЃАрЃбрЃўрЃЋрЃљрЃџрЃў РђърЃЏрЃљрЃюрЃљРђю Рђћ рЃљрЃдрЃЏрЃљрЃАрЃарЃБрЃџрЃћрЃЉрЃћрЃџрЃў рЃЊрЃўрЃарЃћрЃЦрЃбрЃЮрЃарЃў</li><li>1995РђЊ1999 РђЊ рЃњрЃћрЃюрЃћрЃарЃљрЃџрЃБрЃарЃў рЃърЃарЃЮрЃЊрЃўрЃБрЃАрЃћрЃарЃў, TBC TV</li><li>1999РђЊ2002 РђЊ рЃърЃарЃЮрЃЊрЃўрЃБрЃАрЃћрЃарЃЌрЃљ рЃАрЃљрЃЉрЃГрЃЮрЃА рЃљрЃърЃљрЃарЃљрЃбрЃўрЃА рЃБрЃцрЃарЃЮрЃАрЃў</li><li>2002РђЊ2004 РђЊ рЃЊрЃўрЃарЃћрЃЦрЃбрЃЮрЃарЃўрЃА рЃЏрЃЮрЃљрЃЊрЃњрЃўрЃџрЃћ рЃЊрЃљ рЃњрЃћрЃюрЃћрЃарЃљрЃџрЃБрЃарЃў рЃърЃарЃЮрЃЊрЃўрЃБрЃАрЃћрЃарЃў, рЃерЃърЃА РђърЃЏрЃћрЃџрЃЮрЃЊрЃўрЃљ рЃљрЃарЃбрЃўРђю</li><li>2004РђЊ2005 РђЊ рЃњрЃћрЃюрЃћрЃарЃљрЃџрЃБрЃарЃў рЃЊрЃўрЃарЃћрЃЦрЃбрЃЮрЃарЃў, рЃАрЃАрЃўрЃъ рЃЋрЃљрЃАрЃЮ рЃљрЃЉрЃљрЃерЃўрЃФрЃўрЃА рЃЏрЃБрЃАрЃўрЃЎрЃўрЃАрЃљ рЃЊрЃљ рЃЊрЃарЃљрЃЏрЃўрЃА рЃЌрЃћрЃљрЃбрЃарЃерЃў</li><li>2005РђЊ2010 РђЊ рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃљрЃАрЃЌрЃљрЃю рЃБрЃарЃЌрЃўрЃћрЃарЃЌрЃЮрЃЉрЃўрЃА рЃАрЃљрЃЏрЃАрЃљрЃ«рЃБрЃарЃўрЃА рЃБрЃцрЃарЃЮрЃАрЃў, рЃерЃърЃА РђърЃфрЃћрЃюрЃбрЃа рЃърЃЮрЃўрЃюрЃбрЃў рЃ»рЃњрЃБрЃцрЃўРђю</li><li>2011 РђЊ рЃЊрЃљрЃљрЃцрЃБрЃФрЃюрЃљ рЃерЃърЃА РђърЃЉрЃўрЃќрЃюрЃћрЃА рЃЎрЃЮрЃюрЃАрЃљрЃџрЃбрЃўрЃюрЃњ рЃЎрЃЮрЃЏрЃърЃљрЃюрЃўрЃљРђю, рЃАрЃљрЃЊрЃљрЃф рЃЊрЃдрЃћрЃЏрЃЊрЃћ рЃљрЃарЃўрЃА рЃЊрЃљрЃЏрЃцрЃБрЃФрЃюрЃћрЃЉрЃћрЃџрЃў рЃърЃљрЃарЃбрЃюрЃўрЃЮрЃарЃў</li><li>2014РђЊ2016 РђЊ рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃА рЃЏрЃарЃЕрЃћрЃЋрЃћрЃџрЃў, рЃЌрЃЉрЃўрЃџрЃўрЃАрЃўрЃА рЃАрЃљрЃЎрЃарЃћрЃЉрЃБрЃџрЃЮрЃерЃў</li><li>2016РђЊ2024 РђЊ рЃЊрЃўрЃарЃћрЃЦрЃбрЃЮрЃарЃў, рЃљ(рЃљ)рЃўрЃъ рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃЮрЃЉрЃўрЃА рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃАрЃљрЃАрЃљрЃ«рЃџрЃћ</li><li>2024 РђЊ рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃАрЃљ рЃЊрЃљ рЃАрЃърЃЮрЃарЃбрЃўрЃА рЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃљрЃЊ рЃЊрЃљрЃўрЃюрЃўрЃерЃюрЃљ</li></ul><p><br></p>',
