    'title' => 'рЃЊрЃћрЃЉрЃБрЃџрЃћрЃЉрЃљ',
    'content' => '<h2>рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃА рЃАрЃљрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЮрЃА рЃЊрЃћрЃЉрЃБрЃџрЃћрЃЉрЃљ</h2><p><strong>рЃЊрЃљрЃЏрЃбрЃЎрЃўрЃфрЃћрЃЉрЃБрЃџрЃўрЃљ:</strong> рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЏрЃЌрЃљрЃЋрЃарЃЮрЃЉрЃўрЃА Рёќ ___ рЃЊрЃљрЃЊрЃњрЃћрЃюрЃўрЃџрЃћрЃЉрЃўрЃЌ<br> <strong>рЃЌрЃљрЃарЃўрЃдрЃў:</strong> ___ _<strong>, 20</strong> рЃгрЃћрЃџрЃў<br> <strong>рЃАрЃбрЃљрЃбрЃБрЃАрЃў:</strong> рЃФрЃљрЃџрЃљрЃерЃўрЃљ</p><h3>рЃЌрЃљрЃЋрЃў I РђЊ рЃќрЃЮрЃњрЃљрЃЊрЃў рЃЊрЃћрЃЉрЃБрЃџрЃћрЃЉрЃћрЃЉрЃў</h3><p><strong>рЃЏрЃБрЃ«рЃџрЃў 1 РђЊ рЃЊрЃљрЃАрЃљрЃ«рЃћрЃџрЃћрЃЉрЃљ рЃЊрЃљ рЃАрЃљрЃЏрЃљрЃарЃЌрЃџрЃћрЃЉрЃарЃўрЃЋрЃў рЃАрЃбрЃљрЃбрЃБрЃАрЃў</strong><br> рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃА рЃАрЃљрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЮ рЃгрЃљрЃарЃЏрЃЮрЃљрЃЊрЃњрЃћрЃюрЃА рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЏрЃЌрЃљрЃЋрЃарЃЮрЃЉрЃўрЃА рЃАрЃўрЃАрЃбрЃћрЃЏрЃљрЃерЃў рЃерЃћрЃЏрЃљрЃЋрЃљрЃџ рЃљрЃдрЃЏрЃљрЃАрЃарЃБрЃџрЃћрЃЉрЃћрЃџ рЃЮрЃарЃњрЃљрЃюрЃЮрЃА, рЃарЃЮрЃЏрЃћрЃџрЃўрЃф рЃљрЃ«рЃЮрЃарЃфрЃўрЃћрЃџрЃћрЃЉрЃА рЃЌрЃљрЃЋрЃўрЃА рЃБрЃцрЃџрЃћрЃЉрЃљрЃЏрЃЮрЃАрЃўрЃџрЃћрЃЉрЃљрЃА рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЎрЃЮрЃюрЃАрЃбрЃўрЃбрЃБрЃфрЃўрЃўрЃАрЃљ рЃЊрЃљ рЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃў рЃЎрЃљрЃюрЃЮрЃюрЃЏрЃЊрЃћрЃЉрЃџрЃЮрЃЉрЃўрЃА рЃАрЃљрЃцрЃБрЃФрЃЋрЃћрЃџрЃќрЃћ.<br> рЃАрЃљрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЮрЃА рЃњрЃљрЃљрЃЕрЃюрЃўрЃљ рЃЉрЃћрЃГрЃћрЃЊрЃў, рЃћрЃЏрЃЉрЃџрЃћрЃЏрЃљ, рЃгрЃћрЃарЃўрЃџрЃЮрЃЉрЃўрЃЌрЃў рЃцрЃЮрЃарЃЏрЃљ рЃЊрЃљ рЃАрЃљрЃЉрЃўрЃБрЃ»рЃћрЃбрЃЮ рЃљрЃюрЃњрЃљрЃарЃўрЃерЃћрЃЉрЃў. рЃўрЃА рЃцрЃџрЃЮрЃЉрЃА рЃЏрЃўрЃА рЃЉрЃљрЃџрЃљрЃюрЃАрЃќрЃћ рЃљрЃарЃАрЃћрЃЉрЃБрЃџрЃў рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃЦрЃЮрЃюрЃћрЃЉрЃљрЃА.</p><h3>рЃЌрЃљрЃЋрЃў II РђЊ рЃАрЃљрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЮрЃА рЃЏрЃўрЃќрЃљрЃюрЃў рЃЊрЃљ рЃАрЃљрЃЦрЃЏрЃўрЃљрЃюрЃЮрЃЉрЃўрЃА рЃАрЃцрЃћрЃарЃЮ</h3><p><strong>рЃЏрЃБрЃ«рЃџрЃў 2 РђЊ рЃЏрЃўрЃќрЃљрЃюрЃў рЃЊрЃљ рЃљрЃЏрЃЮрЃфрЃљрЃюрЃћрЃЉрЃў</strong><br> рЃАрЃљрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЮрЃА рЃЏрЃўрЃќрЃљрЃюрЃўрЃљ рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃА рЃАрЃцрЃћрЃарЃЮрЃерЃў рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃърЃЮрЃџрЃўрЃбрЃўрЃЎрЃўрЃА рЃерЃћрЃЏрЃБрЃерЃљрЃЋрЃћрЃЉрЃљ рЃЊрЃљ рЃњрЃљрЃюрЃ«рЃЮрЃарЃфрЃўрЃћрЃџрЃћрЃЉрЃљ, рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃЎрЃБрЃџрЃбрЃБрЃарЃБрЃџрЃў рЃЏрЃћрЃЏрЃЎрЃЋрЃўрЃЊрЃарЃћрЃЮрЃЉрЃўрЃА рЃЊрЃљрЃфрЃЋрЃљ, рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃерЃћрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃўрЃЌрЃў рЃўрЃюрЃЊрЃБрЃАрЃбрЃарЃўрЃћрЃЉрЃўрЃА рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃљ.</p><p><strong>рЃЏрЃБрЃ«рЃџрЃў 3 РђЊ рЃцрЃБрЃюрЃЦрЃфрЃўрЃћрЃЉрЃў</strong><br> рЃАрЃљрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЮ рЃБрЃќрЃарЃБрЃюрЃЋрЃћрЃџрЃДрЃЮрЃцрЃА:</p><ul><li>рЃЎрЃБрЃџрЃбрЃБрЃарЃБрЃџрЃў рЃЏрЃћрЃЏрЃЎрЃЋрЃўрЃЊрЃарЃћрЃЮрЃЉрЃўрЃА рЃЊрЃљрЃфрЃЋрЃљрЃАрЃљ рЃЊрЃљ рЃљрЃдрЃЊрЃњрЃћрЃюрЃљрЃА;</li><li>рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃА рЃ«рЃћрЃџрЃЏрЃўрЃАрЃљрЃгрЃЋрЃЊрЃЮрЃЏрЃЮрЃЉрЃљрЃАрЃљ рЃЊрЃљ рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃљрЃА;</li><li>рЃерЃћрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃўрЃЌрЃў рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА рЃ«рЃћрЃџрЃерЃћрЃгрЃДрЃЮрЃЉрЃљрЃА;</li><li>рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЌрЃљрЃюрЃљрЃЏрЃерЃарЃЮрЃЏрЃџрЃЮрЃЉрЃўрЃА рЃњрЃљрЃдрЃарЃЏрЃљрЃЋрЃћрЃЉрЃљрЃА рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃА рЃАрЃцрЃћрЃарЃЮрЃерЃў;</li><li>рЃЎрЃБрЃџрЃбрЃБрЃарЃБрЃџрЃў рЃърЃарЃЮрЃћрЃЦрЃбрЃћрЃЉрЃўрЃА рЃЊрЃљрЃцрЃўрЃюрЃљрЃюрЃАрЃћрЃЉрЃљрЃАрЃљ рЃЊрЃљ рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃћрЃЉрЃљрЃА;</li><li>рЃерЃћрЃАрЃљрЃЉрЃљрЃЏрЃўрЃАрЃў рЃБрЃгрЃДрЃћрЃЉрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃАрЃАрЃўрЃъ-рЃћрЃЉрЃўрЃА рЃЎрЃЮрЃЮрЃарЃЊрЃўрЃюрЃљрЃфрЃўрЃљрЃА.</li></ul><h3>рЃЌрЃљрЃЋрЃў III РђЊ рЃАрЃљрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЮрЃА рЃБрЃцрЃџрЃћрЃЉрЃљрЃЏрЃЮрЃАрЃўрЃџрЃћрЃЉрЃљ</h3><p><strong>рЃЏрЃБрЃ«рЃџрЃў 4 РђЊ рЃБрЃцрЃџрЃћрЃЉрЃљрЃЏрЃЮрЃАрЃўрЃџрЃћрЃЉрЃљ рЃЊрЃљ рЃАрЃљрЃЦрЃЏрЃўрЃљрЃюрЃЮрЃЉрЃўрЃА рЃњрЃљрЃюрЃ«рЃЮрЃарЃфрЃўрЃћрЃџрЃћрЃЉрЃљ</strong><br> рЃАрЃљрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЮрЃА рЃБрЃцрЃџрЃћрЃЉрЃљ рЃљрЃЦрЃЋрЃА:</p><ul><li>рЃЏрЃЮрЃљрЃЏрЃќрЃљрЃЊрЃЮрЃА рЃЎрЃљрЃюрЃЮрЃюрЃерЃћрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃўрЃЌрЃў рЃўрЃюрЃўрЃфрЃўрЃљрЃбрЃўрЃЋрЃћрЃЉрЃў;</li><li>рЃерЃћрЃўрЃЏрЃБрЃерЃљрЃЮрЃА рЃЊрЃљ рЃЊрЃљрЃљрЃЏрЃбрЃЎрЃўрЃфрЃЮрЃА рЃАрЃљрЃЏрЃљрЃарЃЌрЃџрЃћрЃЉрЃарЃўрЃЋрЃў рЃљрЃЦрЃбрЃћрЃЉрЃў рЃЏрЃўрЃА рЃЎрЃЮрЃЏрЃърЃћрЃбрЃћрЃюрЃфрЃўрЃљрЃерЃў;</li><li>рЃБрЃќрЃарЃБрЃюрЃЋрЃћрЃџрЃДрЃЮрЃА рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃА рЃАрЃцрЃћрЃарЃЮрЃерЃў рЃърЃарЃЮрЃњрЃарЃљрЃЏрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃдрЃЮрЃюрЃўрЃАрЃФрЃўрЃћрЃЉрЃћрЃЉрЃўрЃА рЃњрЃљрЃюрЃ«рЃЮрЃарЃфрЃўрЃћрЃџрЃћрЃЉрЃљ;</li><li>рЃњрЃљрЃБрЃгрЃўрЃЮрЃА рЃЏрЃћрЃЌрЃЋрЃљрЃџрЃДрЃБрЃарЃћрЃЮрЃЉрЃљ рЃЏрЃўрЃА рЃЊрЃљрЃЦрЃЋрЃћрЃЏрЃЊрЃћрЃЉрЃљрЃарЃћрЃЉрЃљрЃерЃў рЃЏрЃДрЃЮрЃц рЃАрЃљрЃ»рЃљрЃарЃЮ рЃАрЃљрЃЏрЃљрЃарЃЌрЃџрЃўрЃА рЃўрЃБрЃарЃўрЃЊрЃўрЃБрЃџ рЃърЃўрЃарЃћрЃЉрЃА;</li><li>рЃњрЃљрЃАрЃфрЃћрЃА рЃњрЃарЃљрЃюрЃбрЃћрЃЉрЃў, рЃАрЃбрЃўрЃърЃћрЃюрЃЊрЃўрЃћрЃЉрЃў рЃЊрЃљ рЃърЃарЃћрЃЏрЃўрЃћрЃЉрЃў;</li><li>рЃњрЃљрЃюрЃљрЃ«рЃЮрЃарЃфрЃўрЃћрЃџрЃЮрЃА рЃЌрЃљрЃюрЃљрЃЏрЃерЃарЃЮрЃЏрЃџрЃЮрЃЉрЃљ рЃљрЃЊрЃњрЃўрЃџрЃЮрЃЉрЃарЃўрЃЋ рЃЊрЃљ рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃљрЃфрЃўрЃћрЃЉрЃЌрЃљрЃю.</li></ul><h3>рЃЌрЃљрЃЋрЃў IV РђЊ рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃљрЃфрЃўрЃБрЃџрЃў рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃљ</h3><p><strong>рЃЏрЃБрЃ«рЃџрЃў 5 РђЊ рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃљ рЃЊрЃљ рЃЏрЃљрЃарЃЌрЃЋрЃўрЃА рЃћрЃарЃЌрЃћрЃБрЃџрЃћрЃЉрЃў</strong><br> рЃАрЃљрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЮрЃА рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃљрЃерЃў рЃерЃћрЃЊрЃўрЃА:</p><ul><li>рЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃў;</li><li>рЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃўрЃА рЃЏрЃЮрЃљрЃЊрЃњрЃўрЃџрЃћрЃћрЃЉрЃў;</li><li>рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃБрЃџрЃў рЃћрЃарЃЌрЃћрЃБрЃџрЃћрЃЉрЃў (рЃЊрЃћрЃърЃљрЃарЃбрЃљрЃЏрЃћрЃюрЃбрЃћрЃЉрЃў, рЃАрЃљрЃЏрЃАрЃљрЃ«рЃБрЃарЃћрЃЉрЃў);</li><li>рЃЏрЃљрЃАрЃќрЃћ рЃЊрЃљрЃЦрЃЋрЃћрЃЏрЃЊрЃћрЃЉрЃљрЃарЃћрЃЉрЃБрЃџрЃў рЃАрЃљрЃ»рЃљрЃарЃЮ рЃАрЃљрЃЏрЃљрЃарЃЌрЃџрЃўрЃА рЃўрЃБрЃарЃўрЃЊрЃўрЃБрЃџрЃў рЃърЃўрЃарЃћрЃЉрЃў (рЃЏрЃљрЃњрЃљрЃџрЃўрЃЌрЃљрЃЊ: рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃЏрЃБрЃќрЃћрЃБрЃЏрЃў, рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃљ, рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃЮрЃЉрЃўрЃА рЃАрЃљрЃАрЃљрЃ«рЃџрЃћ рЃЊрЃљ рЃАрЃ«рЃЋ.).</li></ul><h3>рЃЌрЃљрЃЋрЃў V РђЊ рЃЏрЃљрЃарЃЌрЃЋрЃљ рЃЊрЃљ рЃљрЃюрЃњрЃљрЃарЃўрЃерЃЋрЃљрЃџрЃЊрЃћрЃЉрЃБрЃџрЃћрЃЉрЃљ</h3><p><strong>рЃЏрЃБрЃ«рЃџрЃў 6 РђЊ рЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃў</strong><br> рЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃў рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃЮрЃЉрЃА рЃАрЃљрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЮрЃА, рЃгрЃљрЃарЃЏрЃЮрЃљрЃЊрЃњрЃћрЃюрЃА рЃЏрЃљрЃА рЃЊрЃљ рЃърЃљрЃАрЃБрЃ«рЃА рЃљрЃњрЃћрЃЉрЃА рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЏрЃЌрЃљрЃЋрЃарЃЮрЃЉрЃўрЃА рЃгрЃўрЃюрЃљрЃерЃћ. рЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃў рЃњрЃљрЃюрЃАрЃљрЃќрЃдрЃЋрЃарЃљрЃЋрЃА рЃАрЃљрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЮрЃА рЃърЃарЃўрЃЮрЃарЃўрЃбрЃћрЃбрЃћрЃЉрЃАрЃљ рЃЊрЃљ рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃўрЃА рЃЏрЃўрЃЏрЃљрЃарЃЌрЃБрЃџрЃћрЃЉрЃћрЃЉрЃА.</p><p><strong>рЃЏрЃБрЃ«рЃџрЃў 7 РђЊ рЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃўрЃА рЃЏрЃЮрЃљрЃЊрЃњрЃўрЃџрЃћрЃћрЃЉрЃў</strong><br> рЃЏрЃЮрЃљрЃЊрЃњрЃўрЃџрЃћрЃћрЃЉрЃў рЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃўрЃА рЃњрЃљрЃюрЃЎрЃљрЃарЃњрЃБрЃџрЃћрЃЉрЃўрЃЌ рЃљрЃАрЃарЃБрЃџрЃћрЃЉрЃћрЃю рЃЏрЃљрЃЌрЃќрЃћ рЃЊрЃљрЃЎрЃўрЃАрЃарЃћрЃЉрЃБрЃџ рЃБрЃцрЃџрЃћрЃЉрЃљрЃЏрЃЮрЃАрЃўрЃџрЃћрЃЉрЃћрЃЉрЃА рЃЊрЃљ рЃАрЃљрЃГрЃўрЃарЃЮрЃћрЃЉрЃўрЃА рЃерЃћрЃЏрЃЌрЃ«рЃЋрЃћрЃЋрЃљрЃерЃў рЃўрЃфрЃЋрЃџрЃўрЃљрЃю рЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃА.</p><h3>рЃЌрЃљрЃЋрЃў VI РђЊ рЃЊрЃљрЃАрЃЎрЃЋрЃюрЃўрЃЌрЃў рЃЊрЃћрЃЉрЃБрЃџрЃћрЃЉрЃћрЃЉрЃў</h3><p><strong>рЃЏрЃБрЃ«рЃџрЃў 8 РђЊ рЃЊрЃћрЃЉрЃБрЃџрЃћрЃЉрЃљрЃерЃў рЃфрЃЋрЃџрЃўрЃџрЃћрЃЉрЃћрЃЉрЃў</strong><br> рЃЊрЃћрЃЉрЃБрЃџрЃћрЃЉрЃљрЃерЃў рЃфрЃЋрЃџрЃўрЃџрЃћрЃЉрЃћрЃЉрЃўрЃА рЃерЃћрЃбрЃљрЃюрЃљ рЃ«рЃЮрЃарЃфрЃўрЃћрЃџрЃЊрЃћрЃЉрЃљ рЃЏрЃ«рЃЮрЃџрЃЮрЃЊ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЏрЃЌрЃљрЃЋрЃарЃЮрЃЉрЃўрЃА рЃерЃћрЃАрЃљрЃЉрЃљрЃЏрЃўрЃАрЃў рЃЊрЃљрЃЊрЃњрЃћрЃюрЃўрЃџрЃћрЃЉрЃўрЃЌ.</p><p><strong>рЃЏрЃБрЃ«рЃџрЃў 9 РђЊ рЃљрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃљ</strong><br> рЃЊрЃћрЃЉрЃБрЃџрЃћрЃЉрЃљ рЃФрЃљрЃџрЃљрЃерЃў рЃерЃћрЃЊрЃўрЃА рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЏрЃЌрЃљрЃЋрЃарЃЮрЃЉрЃўрЃА рЃЏрЃўрЃћрЃа рЃЏрЃўрЃАрЃў рЃЊрЃљрЃЏрЃбрЃЎрЃўрЃфрЃћрЃЉрЃўрЃАрЃЌрЃљрЃюрЃљрЃЋрЃћ.</p><h2><br></h2>',
